	public static int lengthOfLongestSubstring(String s) {
		   int max = 0;
		   //Map<String, Boolean> repeat = new HashMap<String, Boolean> ();
		   Map<Character, Integer> lastIndexMap = new HashMap<Character, Integer> ();
		   
		   int currLength = 0;
		   for (int i=0; i<s.length(); i++)
		   {
			   s.charAt(i);
			   
			   if (lastIndexMap.get(s.charAt(i)) == null)
			   {
				   currLength++;
			   }
			   else if ((i - lastIndexMap.get(s.charAt(i)) > currLength ))
			   {
				   currLength++;
			   }
			   else
			   {
				   if (currLength > max)
				   {
					   max = currLength;
				   }
				   currLength = i - lastIndexMap.get(s.charAt(i));
			   }
			   
			   lastIndexMap.put(s.charAt(i), i);
			   
		   }
		   
		   if (currLength > max)
		   {
			   max = currLength;
		   }
		   
		   return max;

	   }
	
	
	 
   public static int lengthOfLongestSubstring2(String s) {
	   
	   int max = 0;
	   Map<String, Boolean> repeat = new HashMap<String, Boolean> ();
	   
	   
	   for (int i=0; i<s.length(); i++)
	   {
		   for (int j=i; j<s.length(); j++)
		   {
			   if (!isRepeat(s.substring(i, j+1), repeat))
			   {
				   if ((j-i+1) > max)
				   {
					   max = (j-i+1);
				   }
						   
			   }
			  
		   }
	   }
	   return max;
   }
   
   
   public static boolean isRepeat(String s, Map<String, Boolean> repeat)
   {
	   Boolean temp = repeat.get(s);
	   if (temp != null)
	   {
		   return temp; 
	   }
		  
	   boolean isRepeat = false;
	   Set<Character> chars = new HashSet<Character>();
	   
	   for (int i=0; i<s.length(); i++)
	   {
		   if (chars.contains(s.charAt(i)))
		   {
			   repeat.put(s, true);
			   return true;
		   }
		   chars.add(s.charAt(i));
	   }
	   repeat.put(s, false);
	   return isRepeat;
	   
   }
   
   
